              "modifier_list_data": {
                "type": "object",
                "description": "A container for a list of modifiers, or a text-based modifier.\nFor text-based modifiers, this represents text configuration for an item. (For example, custom text to print on a t-shirt).\nFor non text-based modifiers, this represents a list of modifiers that can be applied to items at the time of sale.\n(For example, a list of condiments for a hot dog, or a list of ice cream flavors).\nEach element of the modifier list is a `CatalogObject` instance of the `MODIFIER` type.",
                "x-release-status": "PUBLIC",
                "properties": {
                  "name": {
                    "type": "string",
                    "description": "The name of the `CatalogModifierList` instance. This is a searchable attribute for use in applicable query filters, and its value length is of \nUnicode code points.",
                    "maxLength": 255,
                    "nullable": true
                  },
                  "ordinal": {
                    "type": "integer",
                    "description": "The position of this `CatalogModifierList` within a list of `CatalogModifierList` instances.",
                    "nullable": true
                  },
                  "selection_type": {
                    "type": "string",
                    "enum": [
                      "SINGLE",
                      "MULTIPLE"
                    ],
                    "x-enum-elements": [
                      {
                        "name": "SINGLE",
                        "description": "Indicates that a CatalogModifierList allows only a\nsingle CatalogModifier to be selected."
                      },
                      {
                        "name": "MULTIPLE",
                        "description": "Indicates that a CatalogModifierList allows multiple\nCatalogModifier to be selected."
                      }
                    ],
                    "description": "Indicates whether a CatalogModifierList supports multiple selections.",
                    "x-release-status": "PUBLIC"
                  },
                  "modifiers": {
                    "type": "array",
                    "items": {
                      "$ref": "#/components/schemas/CatalogObject",
                      "has_circular_reference": true
                    },
                    "description": "A non-empty list of `CatalogModifier` objects to be included in the `CatalogModifierList`, \nfor non text-based modifiers when the `modifier_type` attribute is `LIST`. Each element of this list \nis a `CatalogObject` instance of the `MODIFIER` type, containing the following attributes:\n```\n{\n\"id\": \"{{catalog_modifier_id}}\",\n\"type\": \"MODIFIER\", \n\"modifier_data\": {{a CatalogModifier instance>}} \n}\n```",
                    "nullable": true
                  },
                  "image_ids": {
                    "type": "array",
                    "items": {
                      "type": "string"
                    },
                    "description": "The IDs of images associated with this `CatalogModifierList` instance.\nCurrently these images are not displayed on Square products, but may be displayed in 3rd-party applications.",
                    "nullable": true
                  },
                  "allow_quantities": {
                    "type": "boolean",
                    "description": "When `true`, allows multiple quantities of the same modifier to be selected.",
                    "x-release-status": "BETA",
                    "nullable": true
                  },
                  "is_conversational": {
                    "type": "boolean",
                    "description": "True if modifiers belonging to this list can be used conversationally.",
                    "x-release-status": "BETA",
                    "nullable": true
                  },
                  "modifier_type": {
                    "type": "string",
                    "enum": [
                      "LIST",
                      "TEXT"
                    ],
                    "x-enum-elements": [
                      {
                        "name": "LIST",
                        "description": "The `CatalogModifierList` instance is a non-empty list of non text-based modifiers."
                      },
                      {
                        "name": "TEXT",
                        "description": "The `CatalogModifierList` instance is a single text-based modifier."
                      }
                    ],
                    "description": "Defines the type of `CatalogModifierList`.",
                    "x-release-status": "BETA"
                  },
                  "max_length": {
                    "type": "integer",
                    "description": "The maximum length, in Unicode points, of the text string of the text-based modifier as represented by \nthis `CatalogModifierList` object with the `modifier_type` set to `TEXT`.",
                    "x-release-status": "BETA",
                    "nullable": true
                  },
                  "text_required": {
                    "type": "boolean",
                    "description": "Whether the text string must be a non-empty string (`true`) or not (`false`) for a text-based modifier\nas represented by this `CatalogModifierList` object with the `modifier_type` set to `TEXT`.",
                    "x-release-status": "BETA",
                    "nullable": true
                  },
                  "internal_name": {
                    "type": "string",
                    "description": "A note for internal use by the business.   \n\nFor example, for a text-based modifier applied to a T-shirt item, if the buyer-supplied text of \"Hello, Kitty!\"  \nis to be printed on the T-shirt, this `internal_name` attribute can be \"Use italic face\" as \nan instruction for the business to follow.  \n\nFor non text-based modifiers, this `internal_name` attribute can be \nused to include SKUs, internal codes, or supplemental descriptions for internal use.",
                    "maxLength": 512,
                    "x-release-status": "BETA",
                    "nullable": true
                  },
                  "min_selected_modifiers": {
                    "type": "integer",
                    "description": "The minimum number of modifiers that must be selected from this list. The value can be overridden with `CatalogItemModifierListInfo`.\n\nValues:\n\n- 0: No selection is required.\n- -1: Default value, the attribute was not set by the client. Treated as no selection required.\n- &gt;0: The required minimum modifier selections. This can be larger than the total `CatalogModifiers` when `allow_quantities` is enabled.\n- &lt; -1: Invalid. Treated as no selection required.",
                    "format": "int64",
                    "x-release-status": "BETA",
                    "nullable": true
                  },
                  "max_selected_modifiers": {
                    "type": "integer",
                    "description": "The maximum number of modifiers that must be selected from this list. The value can be overridden with `CatalogItemModifierListInfo`.\n\nValues:\n\n- 0: No maximum limit.\n- -1: Default value, the attribute was not set by the client. Treated as no maximum limit.\n- &gt;0: The maximum total modifier selections. This can be larger than the total `CatalogModifiers` when `allow_quantities` is enabled.\n- &lt; -1: Invalid. Treated as no maximum limit.",
                    "format": "int64",
                    "x-release-status": "BETA",
                    "nullable": true
                  },
                  "hidden_from_customer": {
                    "type": "boolean",
                    "description": "If `true`, modifiers from this list are hidden from customer receipts. The default value is `false`.\nThis setting can be overridden with `CatalogItemModifierListInfo.hidden_from_customer_override`.",
                    "x-release-status": "BETA",
                    "nullable": true
                  }
